import React, { useState } from 'react';
import {
	BrowserRouter as Router,
	Routes,
	Route,
	NavLink,
	Outlet,
	useParams,
	useLocation,
} from 'react-router-dom';
import style from './SubNav.module.css';
import ProjectTitle from '../projectTitle/ProjectTitle';
import axios from 'axios';

const SubNav = (props) => {
	const type = props.type;
	const navItems = props.navItems;
	console.log(navItems);
	const [subNavActive, setSubNavActive] = useState(false);
	const [subNavType, setSubNavType] = useState('');

	const subNav = (type, subProjects) => {
		setSubNavActive(true);
		setSubNavType(type);
	};

	return (
		<div className={style.container}>
			<ul>
				{navItems.map((navItem) =>
					!navItem.gallery ? (
						<NavLink to={`/${type}/${navItem.slug}`}>
							<li onClick={() => subNav(type, navItem.subProjects)}>
								{navItem.title}
							</li>
						</NavLink>
					) : (
						<NavLink to={`/gallery/${navItem.slug}`}>
							<li>{navItem.title}</li>
						</NavLink>
					)
				)}
			</ul>
			{setSubNavActive && <SubNav type={type} />}
		</div>
	);
};

export default SubNav;
